import { Container  } from "react-bootstrap"
import Buttons from "./components/buttons";
import { persons } from "./data"
import List from "./components/list";
import Count from "./components/header"
import { useState } from "react";

function App() {
  const [personData, setpersonData] = useState({persons})
  const onDelete =()=>{
    setpersonData([]) 
  }

  return ( 
    <Container className="py-5 font body " >

    <Count persons={personData} />

    <List persons={personData} />
    <Buttons deleteData={onDelete} />

    </Container>

  );
}

export default App;
